import Head from 'next/head';
import Link from 'next/link';
import Layout from '../components/layout';

export default function Resume() {
  return (
    <Layout>
      <Head>
        <title>Resume</title>
      </Head>
      <h1>Resume</h1>
      <h2>
        <Link href='/'>
          <a>Back to home</a>
        </Link>
      </h2>
    </Layout>
  );
}
